DROP DATABASE IF EXISTS affordabilityModule;

CREATE DATABASE affordabilityModule;

use affordabilityModule;

CREATE TABLE home (
	id INT PRIMARY KEY AUTO_INCREMENT,
	totalPrice INT,
	detailsId INT
);

CREATE TABLE similarHomes (
	id INT PRIMARY KEY AUTO_INCREMENT,
	homeId INT,
	image VARCHAR(255),
	price INT,
	rooms VARCHAR(100),
	baths VARCHAR(100),
	address1 VARCHAR(255),
	address2 VARCHAR(255)
);

CREATE TABLE homeDetails (
	id INT PRIMARY KEY AUTO_INCREMENT,
	overviewId INT,
	description TEXT,
	featuresId INT
);

CREATE TABLE overview (
	id INT PRIMARY KEY AUTO_INCREMENT,
	type VARCHAR(100),
	rooms VARCHAR(100),
	baths VARCHAR(100),
	builtIn INT,
	howlongOnTrulia INT,
  lotSize INT,
	sqft INT,
	pricePerSqft INT,
	priceHOA INT,
	views INT
);

CREATE TABLE features (
	id INT PRIMARY KEY AUTO_INCREMENT,
	listingInfoId INT,
	publicRecordsId INT
);

CREATE TABLE listingInfo (
	id INT PRIMARY KEY AUTO_INCREMENT,
	updatedAt VARCHAR(100),
	rooms VARCHAR(100),
	baths VARCHAR(100),
	type VARCHAR(100),
	sqft INT,
	lotSize INT
);

CREATE TABLE publicRecords (
	id INT PRIMARY KEY AUTO_INCREMENT,
	updatedAt VARCHAR(100),
	rooms VARCHAR(100),
	baths VARCHAR(100),
	type VARCHAR(100),
	sqft INT,
	lotSize INT
);

CREATE TABLE priceHistory (
	id INT PRIMARY KEY AUTO_INCREMENT,
	homeDetailsId INT,
	historyDate VARCHAR(100),
	price INT,
	event VARCHAR(100),
	detailsId INT
);

CREATE TABLE priceHistoryDetails (
	id INT PRIMARY KEY AUTO_INCREMENT,
	recordingDate VARCHAR(100),
	contractDate VARCHAR(100),
	salePrice INT,
	priceType VARCHAR(255),
	countyTransferTax VARCHAR(100),
	totalTransferTax VARCHAR(100),
	transactionType VARCHAR(100),
	documentType VARCHAR(100),
	priceChange INT,
	source VARCHAR(100)
);
